import React from "react"
import cs from "./Contact.module.css"

const Contact = (props) =>{
debugger

    {props.ContactValue &&  props.SetIsAnyContact(true)}



    return <span>


        {props.ContactValue &&
        <div className={cs.contact} >
        {props.ContactName} : {props.ContactValue}
        </div>
        }
    </span>
}


export default Contact
